import './App.css';
import { Component } from 'react';
import { VtmnButton } from '@vtmn/react';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
    };
  }

  componentDidMount() {
    fetch('https://sports.api.decathlon.com/sports')
      .then(res => res.json())
      .then(data => this.setState({ data: data['data'] }, () => console.log(this.state.data)));
  }

  render() {
    return (
      <div>
        <VtmnTextInput placeholder="Recherchez" />
        <VtmnButton>Click</VtmnButton>
      </div>
    );
  }
}

export default App;
